import {React, useEffect, useState, useRef } from "react";
//googlemap
import GoogleMapReact from "google-map-react";
//components

//styles & img
import {Style} from './Form.styles'
import person from '../../images/person.png'

export default function MapContainer(props) {

	const Marker = ({ children }) => <div>{children}</div>;

	const [center, setCenter] = useState({})

	useEffect(async() => {
		let lat = parseFloat(props.showMapForUser.startCoord.lat);
		let lng = parseFloat(props.showMapForUser.startCoord.lng);
		setCenter({lat, lng})
	}, [])


	return (
		<Style>
			{center.lat ? 
			<GoogleMapReact 
				bootstrapURLKeys={{key: process.env.REACT_APP_GOOGLE_MAPS_API_KEY}}
				defaultCenter={{ 
					lat: center.lat, 
					lng: center.lng
				}}
				defaultZoom={15}
				yesIWantToUseGoogleMapApiInternals
				onGoogleApiLoaded= {({map, maps}) => {
					useRef(map);
				}}
			>
			<Marker
				key={1} 
				lat={props.showMapForUser.startCoord.lat}
				lng={props.showMapForUser.startCoord.lng}
			>

				<div >
					<img className = "crime-marker" src={person} alt="person" />
				</div>	

			</Marker>
			</GoogleMapReact>
			: console.log("HEJ")}
		</Style>
	);
}
